package Durrr;

public class Swapping1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	int a=10;
	int b=78;
       System.out.println("Before Swapping \na = "+a+ "\nb = "+b);
		
		a=a*b;
		b=a/b;
		a=a/b;
		System.out.println("Before Swapping \na = "+a+ "\nb = "+b);
	}

}
